

def llena_lista():
    lista=[]
    for i in range(5):
        valor=int(input("Enter a number: "))
        lista.append(valor)
    return llena_lista

def imprime_lista(lista):
    tamanio=len(lista)
    for i in range(tamanio):
        print(lista[i],end=" ")

def main():
    mi_lista=llena_lista()
    print(mi_lista)
    imprime_lista(mi_lista)                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                         